import style from "./LoginLayout.module.css";
import { Link } from "react-router-dom";
import TextFormField from "../widget/TextFormField";
import {
  EmailOutlined,
  LockOutlined,
  GitHub,
  Facebook,
  Google,
} from "@material-ui/icons";
import { Button } from "@material-ui/core";

const LoginLayout = (props) => {
  return (
    <div className={style.container}>
      <span style={{ fontSize: "30px", paddingBottom: "10px" }}>Login</span>
      <span style={{ fontSize: "16px" }}>
        If you donâ€™t have an account register
      </span>
      <span style={{ fontSize: "16px", paddingBottom: "1rem" }}>
        You can <Link to="/">Register here !</Link>
      </span>
      <TextFormField lable="Email" icon={<EmailOutlined />} />
      <div style={{ margin: "1rem 0" }}></div>
      <TextFormField lable="Password" icon={<LockOutlined />} />
      <div style={{ margin: "1rem 0" }}></div>
      <Button
        style={{
          color: "white",
          backgroundColor: "#0C21C1",
          borderRadius: "2.5rem",
        }}
      >
        Login
      </Button>
      <span style={{ textAlign: "center" }}>or continue with</span>
      <div className={style.icon}>
        <GitHub />
        <Facebook />
      </div>
    </div>
  );
};
export default LoginLayout;
